export default function reducer(
  state = {
    status: "",
    status_flag: "",
    linkvalue:""
  },
  action
) {
  if (action.type === "SET_STATUS") {
    return Object.assign({}, state, {
      status: action.loginstatus,
      status_flag: action.flag
    });
  }
  return state;
}
